If `throwExpression.arguments` contains a spread expression before or at `optionsIndex`, the position of the options argument isn't obvious. Here's an example:

```js
try {
    doSomething();
} catch (error) {
    const args = [];
    throw new Error(...args);
}
```

In this case, the rule suggests adding an options object as a second argument like this:

```js
try {
    doSomething();
} catch (error) {
    const args = [];
    throw new Error(...args, { cause: error });
}
```

But this actually results in `{ cause: error }` being passed as the _first_ effective argument of the new expression, because `args` is empty.

My first thought is that we could keep reporting this problem without a suggestion, but maybe returning `UNKNOWN_CAUSE` in this case is a better choice, because it's difficult to make assumptions about where the options argument with the `cause` should be even located.

