This works well, but it removes comments and formatting inside and before the argument list. We usually like to keep those elements unchanged when possible ([here](https://eslint.org/play/#) an example with`no-array-constructor` for comparison).

I made my attempt to keep unrelated code unchanged by inserting text only, and this is what I ended up with:

```suggestion
										const astUtils = require("./utils/ast-utils");

										if (!args[0]) {
											const lastToken = sourceCode.getLastToken(throwExpression);
											const lastCalleeToken = sourceCode.getLastToken(throwExpression.callee);
											const parenToken = sourceCode.getFirstTokenBetween(
												lastCalleeToken,
												lastToken,
												astUtils.isOpeningParenToken,
											);

											if (parenToken) {
												return fixer.insertTextAfter(
													parenToken, `"", { cause: ${caughtError.name} }`,
												);
											} else {
												return fixer.insertTextAfter(
													throwExpression.callee, `("", { cause: ${caughtError.name} })`,
												);
											}
										}

										if (!args[1]) {
											return fixer.insertTextAfter(
												args[0], `, { cause: ${caughtError.name} }`,
											);
										}
```

And similary for `AggregateError` (there are duplications that could be optimized).

